import 'bootstrap/dist/css/bootstrap.css';
import React from 'react';
import ReactDOM from 'react-dom/client';
import "./../styles/pages.css"
import $ from 'jquery';
import TimePicker from './TimePicker';
import TextForm from './TextForm';
import DayPicker from './DayPicker';

export default class ActivityRow extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (

            <tr>
                <th scope="row">
                    <TextForm placeholder="es. Cena" />
                </th>
                <td>
                    Dalle:<TimePicker min="00:00" max="23:59" /> Alle:<TimePicker min="00:00" max="23:59" />
                </td>
                <td>
                    <TextForm placeholder="es. 5" />
                </td>
                <td>
                    <TimePicker min="00:00" max="23:59" />
                </td>
                <td>
                    <DayPicker />
                </td>
                <td>
                    <button type="button" className="deleteActivityButton btn btn-outline-danger">
                        <i className="bi bi-trash"></i>
                    </button>
                </td>
            </tr>

        )
    }
}
